class Solution:
    def dailyTemperatures(self, T: List[int]) -> List[int]:
        
        
        result = []
        count = 0
            
        for item in range(len(T)-1):

            if T[item] < T[item+1]:
                count+=1
            else:
                mark = item+1

                while mark < len(T):
                    if T[item] > T[mark] and mark == len(T)-1:
                        count = 0
                        break
                    elif T[item] < T[mark]:
                        count+=1
                    else:
                        count+=1
                        break
                    mark+=1

            result.append(count)

            
        result.append(0)
        
        return result

